import React from "react";
import Navbar from '../components/Navbar.jsx';
import resume from "../components/assets/Daphne_Wu_Resume1.pdf"; // Import the PDF file from your assets

const Resume = () => (
  <div className="bg-gray-100">
    <Navbar />
    <div className="flex justify-center items-center pt-16"> {/* Add padding top to prevent overlap with navbar */}
      <div className="relative w-full max-w-4xl h-[calc(100vh-80px)] overflow-auto"> {/* Set a max width to prevent stretch */}
        {/* Embed the PDF with correct path */}
        <embed
          src={resume} // Use the imported path for the PDF file
          width="100%" 
          height="100%" // Make it fill the container, but stay within the constraints
          type="application/pdf"
          className="border-none"  // Remove any default borders or outlines
        />
        {/* Download link */}
        <a
          href={resume} // Use the imported path for downloading
          download="Daphne_Wu_Resume.pdf" // Suggested filename for download
          className="absolute bottom-10 left-1/2 transform -translate-x-1/2 text-white bg-blue-500 px-6 py-3 rounded-lg hover:bg-blue-600 transition"
        >
          Download Resume
        </a>
      </div>
    </div>
  </div>
);

export default Resume;
